INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3760060005533', 'Corbeille Métal', 'Bouteille 37,5 cl de Bordeaux rouge (contient des _sulfites_). Papillote praliné lait : sucre, praliné 20 % (sucre, pâte de _noisettes_, pâte d\'_amandes_), graisses végétales (palme, palmiste), beurre de cacao, poudre de _lait_ entier, pâte de cacao, _lactosérum_ en poudre, cacao maigre en poudre, arômes (_noisette_), émulsifiant : lécithine, matière grasse de _lait_ anhydre, _lactose_. Ballotin 55 g de truffes fantaisie aux brisures de macaron : matières grasses végétales partiellement hydrogénées (coprah, palmiste), sucre, cacao maigre en poudre, pâte de cacao, _lactosérum_ en poudre, brisures de macaron 5 % (sucre, amidon de _blé_, farine de _blé_, farine d\'_amandes_, albumine d\'_œuf_, arômes naturels, poudre à lever : carbonates de sodium), cacao en poudre, émulsifiant : lécithines de _soja_, arôme naturel de vanille. Pot 200 g de fondant chocolat noir : sucre, huiles végétales (huile de colza, huile de palme, huile de coco), poudre de cacao maigre (14 %), émulsifiant : lécithine de _soja_. Verrine 90 g terrine gourmande de boudin blanc aux cèpes : gorge de porc, viande de volaille, _œufs_ entiers, eau, oignons, cèpes (3 %), amidon transformé de maïs, poudre de _lait_ entier, sel, poivre, gélifiant : carraghénanes, mélange d\'épices (dont cannelle). Verrine 90 g terrine gourmande de sanglier au laurier : gorge et foie de porc, viande de sanglier 20 %, _lait_ (eau, poudre de _lait_), aromates, sel, fécule de pomme de terre, laurier 0,2 %, agar agar, poivre.', 'https://static.openfoodfacts.org/images/products/376/006/000/5533/front_fr.5.400.jpg', '', '', '', '', '', '', '', '', '', '1');

